import React from "react";
import Notes from "./Notes";



const NoteList = ({notes, setNotes}) => {
  return (
    <div className="note-container">
        {notes.map((note, index) => (
          <Notes
            setNotes={setNotes}
            notes={notes}
            key={index}
            title={note.title}
            text={note.text}
            date={note.date}
          />
        ))}
    </div>
  );
};
export default NoteList;
